import React, {Component, Fragment} from 'react';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';


 class MapaTrabajador extends Component{

    render(){

        return(

        <Fragment>

        <Map
          googleMapURL='https://maps.googleapis.com/maps/api/js?key=AIzaSyAArwzjSXp89P_0IQVObJ6d1GVNfneRi-I'
          zoom={17}
          initialCenter={{ lat: 47.444, lng: -122.176}}
        />

        </Fragment>
        );
    }
}

export default MapaTrabajador;
